import { Container, Box, Text } from "@chakra-ui/react";
import React from "react";

const Homepage = () => {
  return (
    <Container maxW="Xl" centerContent>
      <Box d="flex" justifyContent='center' >
        <Text>Chatster</Text>
      </Box>
      <Box></Box>
    </Container>
  );
};

export default Homepage;
